JOIN (
SELECT u.id
FROM users u
WHERE u.name='DONNA GARICA'
) UserID ON ur.userid = UserID.id
WHERE ur.rating > 3) OverThreeSongID
JOIN songs s ON OverThreeSongID.songid = s.id
JOIN albums ab ON s.albumid = ab.id
JOIN artists ar ON s.artistid = ar.id;

